.category_bg {
  position: relative;
  width: 100%;
  height: 350px;
  overflow: hidden;
  background: url(../img/fix.jpg) no-repeat center center;
  background-size: cover;
}

.category_bg .category_nav {
  position: absolute;
  width: 100%;
  height: 100%;
  top: 0;
  left: 0;
  background-color: rgba(0, 0, 0, 0.4);
}

.category_bg .category_nav .nav_p {
  position: absolute;
  width: 20%;
  display: flex;
  justify-content: space-between;
  bottom: 30px;
  left: 30px;
}

.category_bg .category_nav .nav_p p a {
  font-size: 25px;
  color: white;
  font-weight: 700;
}

/*************sub_list*************/
.sub_list {
  padding-top: 50px;
}

.list_wrap {
  display: flex;
  flex-wrap: wrap;
  width: 100%;
  padding: 20px;
}

.product_box {
  width: calc(25% - 15px);
  margin-right: 20px;
  margin-bottom: 20px;
}

.product_box:nth-child(4n) {
  margin-right: 0;
}

.product_box .product_img {
  position: relative;
  overflow: hidden;
}

.product_box .product_img img {
  width: 100%;
  transition: all 0.3s;
}

.product_box .product_img:hover img {
  transform: scale(1.2);
}

.product_box .product_img .hover_box {
  display: flex;
  align-items: center;
  width: 100%;
  height: 50px;
  background-color: rgba(0, 0, 0, 0.4);
  position: absolute;
  bottom: -20%;
  transition: all 0.3s;
}

.product_box .product_img:hover .hover_box {
  bottom: 0;
}

.product_box .hover_box>div {
  width: 50%;
  text-align: center;
  cursor: pointer;
}

.product_box .hover_box>div span {
  color: #fff;
  transition: all 0.3s;
  font-size: 30px;
}

.product_box .hover_box>div:hover span {
  color: red;
}

.detail {
  position: relative;
  display: flex;
  justify-content: space-between;
  padding: 10px 0;
}

.detail a p {
  color: #000;
}

.detail p.category {
  font-size: 12px;
}

.detail p.product_name {
  font-size: 18px;
  font-weight: bold;
  margin: 5px 0;
}

.detail p.product_price {
  font-size: 14px;
  color: #a8a8a8;
  font-weight: bold;
}

.detail .buy_btn {
  position: absolute;
  width: 30%;
  bottom: 0;
  right: 0;
}

.detail .buy_btn a {
  display: block;
  color: #002053;
  padding: 5px 30px;
  border: 1px solid #ccc;
  border-radius: 30px;
  transition: all 0.3s;
  text-align: center;
  font-size: 18px;
}

.detail .buy_btn:hover a {
  background-color: #002053;
  color: #fff;
}
